def read_file(filepath):
    try:
        filename = filepath.split('/')[6].replace('.xz','')
        filedate = filename[0:10].replace('_','-')

        data = lzma.open(filepath).read().decode('utf-8')
        df = pd.read_json(json.dumps(json.loads(data)))
        df['data'] = datetime.strptime(filedate, '%Y-%m-%d') - timedelta(days=1)
        return df
    except Exception as err:
        print(err)
        print(filepath)
        print(len(data))
        return pd.DataFrame()

def gera_csv(files,savepath):
    dfall = pd.DataFrame()
    for file in files: 
        df = read_file(file)
        if not df.empty:
            dfall = dfall.append(df,sort=True)
    dfall.to_csv(savepath,index=False,sep=';')
